import React from 'react';
import { players } from 'data/players';
import PropTypes from 'prop-types';

const PlayersList = () => (
  <div>
    <ul>
      {players.map(({ name, average, club, position }) => (
        <li>
          <div>{average}</div>
          <div>
            <p>IMG</p>
            <p>{name}</p>
            <p>{club}</p>
            <p>{position}</p>
          </div>
        </li>
      ))}
    </ul>
  </div>
);

PlayersList.propTypes = {};

export default PlayersList;
